import {MenuModal} from "../MenuModal";
import Modal from "../../../css/modal.module.css"
import {useApi} from "../../api/useApi";

export function GrantPassMenuModal(props){
    const {userApi} = useApi();

    return (
        <MenuModal {...props}>
            <div className={Modal.grant_pass}>
                <div>
                    <div>이번주 패스</div>
                    <input type="password" className={Modal.inp_password}/>
                </div>
                <button type="button" className={Modal.btn_submit}>확인</button>
            </div>
        </MenuModal>
    )
}
